import React from 'react';
import {Avatar, Card} from 'antd';

const UserProfile = () => {
  return (
      <Card
        actions={[
            <div key="twit"></div>
        ]}
      >
        <Card.Meta
            avatar={<Avatar>SJ</Avatar>}
            title="SujinKim"
        />
      </Card>
  );
};

export default UserProfile;
